import { ImageResponse } from "next/og"

export const generateImageMetadata = () => {
    const sizes = [
        [16, 16],
        [32, 32],
        [48, 48],
        [64, 64],
        [96, 96],
        [128, 128],
        [256, 256],
        [512, 512],
    ]
    return sizes.map(([width, height]) => ({
        contentType: "image/svg+xml",
        size: {width, height},
        id: `${width}x${height}`,
    }))
}

